import os
import requests

"""# *Importing Model*"""

github_url = "https://github.com/berlianm/Rubist-Application/raw/main/Model%20Classification/MobileNet%20V2/mobilenet_model.h5"
model = os.path.basename(github_url)

response = requests.get(github_url)
response.raise_for_status()

with open(model, "wb") as f:
    f.write(response.content)

if os.path.exists(model):
    print(f"File '{model}' downloaded successfully.")
else:
    print("File download failed.")

module_selection = ("mobilenet_v2", 224, 1280) #@param ["(\"mobilenet_v2\", 224, 1280)", "(\"inception_v3\", 299, 2048)"] {type:"raw", allow-input: true}
handle_base, pixels, FV_SIZE = module_selection
MODULE_HANDLE ="https://tfhub.dev/google/tf2-preview/{}/feature_vector/4".format(handle_base)
IMAGE_SIZE = (pixels, pixels)
print("Using {} with input size {} and output dimension {}".format(MODULE_HANDLE, IMAGE_SIZE, FV_SIZE))

import tensorflow_hub as hub
do_fine_tuning = True #@param {type:"boolean"}

layers = hub.KerasLayer(MODULE_HANDLE,
                                   input_shape=IMAGE_SIZE + (3,), 
                                   output_shape=[FV_SIZE],
                                   trainable=do_fine_tuning)

"""# *Converting*"""

import tensorflow as tf
model = tf.keras.models.load_model('mobilenet_model.h5', custom_objects={'KerasLayer': layers})
converter = tf.lite.TFLiteConverter.from_keras_model(model)
tflite_model = converter.convert()

with open('model.tflite', 'wb') as f:
  f.write(tflite_model)